import React from 'react';
import ReactDOM from 'react-dom';

class Aplikasi extends React.Component {
    render() {
        console.log(this)
        return <h1>Aplikasi Ke {this.props.ke}</h1>;
    }
}

ReactDOM.render(<Aplikasi ke="10" />, document.getElementById('app'));




























